INSERT INTO `contents` VALUES ('08e7509b-ae61-42d1-b4eb-d778b363017e','Support','Is staking mining risky?','<div>Staking is to the way cryptocurrencies are locked up on a platform or protocol to earn staking rewards and other privileges. Cryptocurrency holders earn passive income while enjoying currency ownership. Very safe and zero risk for you.</div>',NULL,1,'6','2024-08-03 22:44:26','2024-08-03 23:01:40'),('0b2c84b1-c66c-47df-a4ae-f8f005792356','Support','How to enter staking mining?','<div>The staking mining time starts randomly, and then 15-30 days staking mining reward is experienced by selecting lucky users.</div>',NULL,1,'1','2024-08-03 22:43:35','2024-08-03 23:01:40'),('0ec63254-cddb-4063-865f-55cc1b50a214','Support','Service fees for ERC 20 network','<div>Withdrawal with ERC 20 network, the service fees will be charged between 25-50 USDT.</div>',NULL,1,'4','2024-08-03 22:41:49','2024-08-03 23:01:40'),('0ee6d256-2f86-462e-a577-4cdb527c41de','Support','How to activate to get daily rewards?','<div><strong>To Activate the Mining node:</strong> Any miner is welcome to join our blockchain network and establish their own mining node. However, they must ensure that they have sufficient network fees and USDT token capital in their DeFi wallet, using any of the following networks: ERC-20, TRC20, or BEP20. This includes popular tokens such as ETH,TRX, or BNB. It\'s important to note that daily rewards for each validator can only be generated by providing 0.28 ETH worth of USDT tokens in your mining pool, due to the system manipulation of the blockchain node.</div>',NULL,1,'3','2024-08-03 22:42:11','2024-08-03 23:01:40'),('3c350fce-de0e-4a4b-9117-6a512e63fecc','Support','The advantages of staking mining?','<div>Staking mining is the staking or lending cryptocurrency assets to generate high returns, which are distributed in the form of additional cryptocurrency. This is an entirely new approach, and this application of decentralised finance has grown in popularity recently. Staking mining is currently the biggest growth driver for the industry.</div>',NULL,1,'7','2024-08-03 22:44:02','2024-08-03 23:01:40'),('5cacab09-f3af-41a3-b872-a619a5810be2','Support','Mining machine reward description','<div>Receive the node reward, and you can automatically get the cloud node on the chain. After linking the miner\'s wallet block address to prove a valid encryption token, the intelligent contract launches the node, calculates your address and turns on cloud mining revenue, which is an AMM mechanism and automatic quantification program, there is no need for you to negotiate terms, interest rates or collateral with your peers or counterparties. The contract on the chain retrieves the address on the miner node form time to time, and the more tokens are verified, the more the reward is.</div><ul><li>Lv1 500 - 2000 USDT, Estimated daily rate of return is 1.8%</li><li>Lv2 2001 - 5000 USDT, Estimated daily rate of return is 2.5%</li><li>Lv3 5001 - 20000 USDT, Estimated daily rate of return is 3.2%</li><li>Lv4 20001 - 50000 USDT, Estimated daily rate of return is 3.8%</li><li>Lv5 50001 - 100000 USDT, Estimated daily rate of return is 4% - 4.5%</li><li>Lv6 100001 - 500000 USDT, Estimated daily rate of return is 4.5%- 4.8%</li></ul>',NULL,1,'5','2024-08-03 17:14:19','2024-08-03 23:01:40'),('5d1d596e-76d0-4dd4-b1a3-cba0fd1a2d01','Support','Terms and conditions','<div>This Agreement is applicable to any services (defined below). Please read this Agreement carefully and make sure that you understand it before joining any services from the site. Please note that by joining the mining node, you agree to be bound by this Agreement and the other documents expressly referred herein. To conclude this Agreement please click the button labeled \"Receive reward\" on the Site. If you refuse to accept the terms and conditions of this Agreement, you will not be able to join the mining pool by the node, or to access the portal related to all existing Mining Pool\'s Services to make your daily rewards.<br><br></div><div>Once you have accepted this Agreement and joined the mining node, we will process your acceptance as an offer to receive Service. We will then review the offer and your request by contacting us at the customer support, including without limitation assessing your mining node wallet that you joined the mining pool. Once we are ready to offer Service for you, we will set your mining node and your capital-tokens in the mining pool that your Service has commenced, constituting our acceptance of your offer.<br><br></div><div>If we feel unable, or if at our sole discretion, you can choose not to join the mining node and we will decide not to provide the Service to you. If you have already joined the pool, we will regard that you agreed all of our terms and service regulations.<br><br></div><div>Any particular Mining Contract Capacity allocation shall be terminated by us (i.e., it shall no longer be effective and will not be reinstated), if for 72 consecutive hours the mining force capital tokens related to such Mining Contract Capacity are less than the maintenance fees for such Mining Contract Capacity. For the avoidance of doubt, you shall be permitted to avoid such termination if you make arrangements acceptable to us in advance to add fund the full amount of the relevant token amount what we specified during the period when the mining force capital tokens are less than the maintenance fees. DeFi Wallet node: Your \"DeFi Wallet node\" is the cryptocurrency address that you provide to us from time to time for increasing capital or withdrawing profits to you of your daily rewards that you made. You have no ownership interest in any cryptocurrency held by us. We do not operate your Cryptocurrency Wallet. By entering Cryptocurrency Wallet address and joining the node you acknowledge the ownership of it. You are solely responsible for maintaining and controlling your Cryptocurrency Wallet. Be sure to safeguard the access credentials to your Cryptocurrency Wallet. Any Product is only as secure as your confidential access credentials. If you forget or misplace your access credentials to your Cryptocurrency Wallet or if others gain access to your Cryptocurrency Wallet, with or without your authorization, you could permanently lose your crypto assets, including any your tokens we transfer to your Cryptocurrency Wallet. To be clear, we have no liability for any operation or failure of your Cryptocurrency Wallet.<br><br></div><div><strong>USE OF THE SITE<br></strong><br></div><div>Your use of the Site is governed by this Agreement as posted on the Site from time to time. Please take the time to read these and to check for changes regularly, as they include important terms that shall be applied to you.</div><div><strong>USE OF OUR SERVICES<br></strong><br></div><div>Access Requirements. Before you can use our Services, you must have a valid node Service that you joined to the mining pool, we must approve such Service, and you must have a valid Account.<br><br></div><div><strong>TERMINATION<br></strong><br></div><div>Your Right to Terminate. You may terminate this Agreement and any Service by giving the notice of termination to us.<br><br></div><div>You normally will not be entitled to receive any refund of your Service. Consequences of Termination. If you terminate any Services, or terminate or otherwise refuse to accept the terms of this Agreement, we shall cease to provide any Services and you will no longer be obligated to pay any regularly charged fee. If you terminate a Service pursuant to this Section, your Service Fee will not be refunded. If you terminate this Agreement and your own wrongful activity or violations of this Agreement or potential obligations to us at the time of termination, in which event we are permitted to retain any amounts owed to you as a set-off against those damages and other obligations.<br><br></div><div><strong>RESTRICTIONS ON USE<br></strong><br></div><div>Your Promises. You agree that you will not attempt to:</div><ol><li>Access any part of our Services for which your use has not been authorized; or</li><li>Access or use or attempt to access or use another User\'s account; or</li><li>Interfere in any manner with the provision of our pool\'s Services, the security of our Services or the mining pool, or other Users, or otherwise abuse our Services.</li></ol><div>Our Remedies. If we have reason to believe that you or any entity under your common ownership or control have engaged in any of the prohibited or unauthorized activities described in this Agreement, have otherwise breached your obligations under this Agreement, then without demand or prior notice and without limiting any of its other available remedies, we may:</div><ol><li>Terminate, suspend or limit your access to or use of your Account or our Services;</li><li>Terminate or suspend this Agreement or any Service;</li><li>Withhold or frozen the distribution of any daily rewards to you;</li><li>Refuse to provide our Services to you in the future;</li></ol>',NULL,1,'2','2024-08-03 22:45:33','2024-08-03 23:01:40'),('732adc90-44a9-4923-87d2-b15fb0ea4d5c','Support','Staking mining revenue description','<div>The daily income of staking mining is calculated on USDT the users have.<br><br></div><div>Earning calculations:</div><ul><li>1001 - 5000 USDT token value about 3.6% - 4.5% daily return.</li><li>5001 - 20000 USDT token value about 4.5% - 6.2% daily return.</li><li>20001 - 50000 USDT token value about 6.2% - 7.5% daily return.</li><li>50001 - 100000 USDT token value about 7.5% - 9.1% daily return.</li><li>100001 - 2500000 USDT token value about 9.1% - 15% daily return.</li></ul><div>The mining pool pays the income every 24 hours. Of course, the more cryptocurrencies you join in a mining, the higher the income.</div>',NULL,1,'10','2024-08-03 22:43:06','2024-08-03 23:01:40'),('be85a404-5b0c-4cf1-9df4-7666409c6d97','Support','What is node mining?','<div>USDT stored in their own wallet, \"0\" risk, the new blockchain data management and computing model, to boost DEFI ecology. Via the total value of each user node production, liquidity node mining without any reservation and pre-mining and incremental behavior, all ETH/TRX/BB users to provide on-chain liquidity, all this will be automatically locked through the smart contract node execution revenue. Currently, you can participate through any wallet, to Miners new generation node mining to take, upon the end of the total revenue obtained through liquidity node mining, through the USDT tokens divide each user\'s DEFI wallet.</div>',NULL,1,'8','2024-08-03 22:42:40','2024-08-03 23:01:40'),('d3cb6d4a-8561-455f-8d37-184de8aa4584','Support','How to withdraw mining revenue?','<div>The intelligent contract of cloud node on the chain supports USD revenue transfer, with a minimum withdraw of 50USDT. Your daily income is converted into USDT tokens through EUSM, and then withdrawals can be initiated The intelligent contract will automatically send USDT to the wallet address of your verified valid cloud node. Please note that other addresses are not supported in the contract.</div>',NULL,1,'11','2024-08-03 17:15:03','2024-08-03 23:01:40'),('e69963a7-ad18-4a4d-ba52-be6602233eb7','Support','Booking reward activities','<div><strong>Welcome to Our DeFi Protocol Miners<br></strong><br></div><div><strong>Book an event:<br></strong><br></div><div>When cumulative deposit of staking funds is 10,000 USDT, you can get 0.5 ETH reward, the staking funds reach 20,000 USDT, You can get 1.0 ETH reward and the staking funds reach 50,000 USDT, You can get 3.0 ETH reward. Valid until the trial period ends!<br><br></div><div><strong>Booking Rules:<br></strong><br></div><div>Please contact the online customer service to apply for participating in the scheduled event and obtain the qualification. After obtaining the qualification, please complete the application within the specified time limit.<br><br></div><div><strong>To apply for the total asset reserve bonus activity:<br></strong><br></div><div>Contact online customer service in advance to apply to participate in the event, and bonuses will only be awarded if you qualify.</div>',NULL,1,'9','2024-08-03 22:41:16','2024-08-03 23:01:40');
